script: |
  super -f text -I q2604.spq | sort > q2604.out

inputs:
  - name: q2604.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN + col0 + - CAST ( NULL AS REAL ) + + col0 AND - - 66 * + 15 * col0 + - col1 + col1;
  - name: tab0

outputs:
  - name: q2604.out
    data: |
